function initAutocomplete(){autocompleteStart=new google.maps.places.Autocomplete(document.getElementById("directions_start"),{types:["geocode"]}),autocompleteDestination=new google.maps.places.Autocomplete(document.getElementById("directions_destination"),{types:["geocode"]}),autocompleteStart.addListener("place_changed",fillInAddress("start")),autocompleteDestination.addListener("place_changed",fillInAddress)}function fillInAddress(e){ac="start"==e?autocompleteStart:autocompleteDestination;var t=ac.getPlace();for(var o in componentForm)document.getElementById(o).value="",document.getElementById(o).disabled=!1;for(var n=0;n<t.address_components.length;n++){var a=t.address_components[n].types[0];if(componentForm[a]){var c=t.address_components[n][componentForm[a]];document.getElementById(a).value=c}}}function geolocate(e){ac="start"==e?autocompleteStart:autocompleteDestination,navigator.geolocation&&navigator.geolocation.getCurrentPosition(function(e){var t={lat:e.coords.latitude,lng:e.coords.longitude},o=new google.maps.Circle({center:t,radius:e.coords.accuracy});ac.setBounds(o.getBounds())})}var placeSearch,autocompleteStart,autocompleteDestination,componentForm={street_number:"short_name",route:"long_name",locality:"long_name",administrative_area_level_1:"short_name",country:"long_name",postal_code:"short_name"};